import React, {useState, useEffect} from "react";
import List from "../List/List";
import { useSelector, useDispatch } from 'react-redux';
import { getCars } from "../../_actions/subCars";
import CarsM from "./CarsM";

const Cars = ({list, setList}) => {
    const posts = useSelector( state => state.subCars )
    const x = getCars()
    
    useEffect(()=> {
        const carlength2 = posts.length
      
          if(carlength2!==undefined){
            const jsont = JSON.stringify(carlength2);
            localStorage.setItem("carlength", jsont);}
        })
        
   
    return (
    
    <List {...{ setList, list, CarsM, posts, x}}/>

    )
}
export default Cars;
